import Header from './Containers/header.js.js'
import Masthead from './Containers/masthead.js.js'
import Portfolio from './Containers/portfolio.js'
import About from './Containers/about.js.js'
import Footer from './Containers/footer.js'

import './App.css';
function App() {
  return (
    <div>
      <Header />
      <Masthead />
      <Portfolio />
      <About />
      <Footer />
    </div>
  );
}

export default App;
